import { filter } from 'lodash';
import {
  Card,
  Table,
  Stack,
  Avatar,
  Button,
  Checkbox,
  TableRow,
  TableBody,
  TableCell,
  Container,
  Typography,
  TableContainer,
  TablePagination,
  createSvgIcon,
  IconButton,
  Box
} from '@mui/material';
import { Icon } from '@iconify/react';
import FileDownloadOutlinedIcon from '@mui/icons-material/FileDownloadOutlined';
import DeleteIcon from '@mui/icons-material/Delete';
import FileUploadOutlinedIcon from '@mui/icons-material/FileUploadOutlined';
import CreateIcon from '@mui/icons-material/Create';
import { Link as RouterLink } from 'react-router-dom';
import * as React from 'react';
import { useState, useEffect } from 'react';
import Page from '../components/Page';
import { UserListHead, UserListToolbar, UserMoreMenu } from '../components/_dashboard/user';
import Scrollbar from '../components/Scrollbar';
//

export default function Purchase() {
  const [categories, setCategoy] = useState([]);

  const CATEGORYLIST = [
    { name: 'Gift For Her', cost: '1200' },
    { name: 'Birthday Cake', cost: '590' },
    { name: 'Redvelvet Cake', cost: '530' },
    { name: '10 Rose Bouquet', cost: '800' },
    { name: 'Magic Mirror', cost: '1280' },
    { name: 'Customized Cup', cost: '120' },
    { name: 'Personalized Bottle', cost: '300' },
    { name: 'Plant', cost: '200' }
  ];

  return (
    <Page title="PURCHASES - BIZHOPS" backgroundColor="whitesmoke">
      <Container m={2}>
        <Box sx={{ width: '70%' }}>
          <Button variant="contained" color="info" startIcon={<FileDownloadOutlinedIcon />}>
            Import
          </Button>
          &nbsp;&nbsp;
          <Button variant="contained" color="info" startIcon={<FileUploadOutlinedIcon />}>
            Export
          </Button>
          &nbsp;&nbsp;
          <Button variant="contained" color="error" startIcon={<DeleteIcon />}>
            Delete
          </Button>
        </Box>
      </Container>
    </Page>
  );
}
